	add("comeuppance", "{\"term\":\"comeuppance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027come up\u0027 () {{suffix||ance|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A negative outcome which is justly deserved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, Albion Winegar Tourgée, ed., \u0027The Continent; an illustrated weekly magazine\u0027, v 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So when Brown\u0027s second wife turned out a reg\u0027lar ternygrunt, I wa\u0027n\u0027t in no wise upset, for he needed a \u0027\u0027comeuppance\u0027\u0027, an\u0027 he got it in her\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, w:Booth Booth Tarkington, \u0027s:The Magnificent Ambersons/Chapter The Magnificent Ambersons\u0027, ch 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Sunday edition of the principal morning paper even expressed some bitterness under the heading, \u0026quot;Gilded Youths of the Fin-de-Siecle\u0026quot;--this was considered the knowing phrase of the time, especially for Sunday supplements--and there is no doubt that from certain references in this bit of writing some people drew the conclusion that Mr. George Amberson Minafer had not yet got his \u0027\u0027comeuppance\u0027\u0027, a postponement still irritating\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, “Yankee \u0027\u0027Comeuppance\u0027\u0027 in a Lousy Inning”, in \u0027w:Life Life\u0027, v 45, n 15 (October 13), p 34\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Yankees got their \u0027\u0027comeuppance\u0027\u0027 in Milwaukee when the Braves piled up a record score for the first inning of a World Series game\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Peter Hunt, Sheila G. Bannister Ray, eds., \u0027International Companion Encyclopedia of Children\u0027s Literature\u0027, p 862\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"in the anonymous A New Gift for Children (1750), perhaps America\u0027s first secular storybook, and its tales of children who are good and merit rewards, and tales of children who are otherwise and receive their \u0027\u0027comeuppances\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"date\u003d30 October passage\u003d[I]ts main character, Henry (Mr. w:Ewan [Ewan] McGregor), is a successful, intellectual dramatist who seems quite capable of churning out fizzy, challenging works about brilliant but ambivalent revolutionaries, philosophers, etc. But this cleverer-than-thou creature gets his \u0027\u0027comeuppance\u0027\u0027 in \u0026quot;w:The Real Thing The Real Thing,\u0026quot; showing that a very human heart\u0026amp;nbsp;– just like those possessed by the less sesquipedalian\u0026amp;nbsp;– beats beneath his fancy words\", \"priority\":10}]}, \"synonyms\":{}}");

	add("comforter", "{\"term\":\"comforter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027confortour\u0027 from Old french (842-ca. 1400) \u0027conforter\u0027 See comfort.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who comforts someone who is suffering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Let no \u0027\u0027comforter\u0027\u0027 delight mine ear / But such a one whose wrongs do suit with mine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"US) A padded cover for a bed, duvet, continental quilt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"old fashioned, mostly UK) A woollen scarf for winter\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Popular Science Monthly\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The American schoolboy takes off his \u0027\u0027comforter\u0027\u0027 and unbuttons his jacket before going in for a snowball fight\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Captain Markam had been found lying half-insensible, gagged and bound, on the floor of the sitting-room, his hands and feet tightly pinioned, and a woollen \u0027\u0027comforter\u0027\u0027 wound closely round his mouth and neck; whilst Mrs. Markham\u0027s jewel-case, containing valuable jewellery and the secret plans of Port Arthur, had disappeared. ”\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A pacifier\", \"priority\":9}]}, \"synonyms\":{}}");

