	add("comfortfic", "{\"term\":\"comfortfic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|comfort|fic|lang\u003den}}, by analogy with \u0027comfort food\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fan Fan fiction read in order to make oneself feel better when sad, ill, stressed, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("comintern", "{\"term\":\"comintern\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\"], \"text\":\"From Russian \u0027коминте́рн\u0027 contracted abbreviation of \u0027коммунистический|коммуни́сти́ческий интернациона́л\u0027 (tr\u003dkommunístíčeskij intɛrnacionál) from \u0027коммунисти́ческий\u0027 + \u0027интернациона́л\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An international association of Communist parties, established in 1919 by Vladimir Lenin and dissolved in 1943\", \"priority\":1}]}, \"synonyms\":{}}");

	add("comitadji", "{\"term\":\"comitadji\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Turkish\"], \"text\":\"From various Balkan languages, all from Turkish \u0027komitacı\u0027 \u0026lt;ref\u0026gt;[http://www.merriam-webster.com/dictionary/komitadji \u0026quot;komitadji.\u0026quot;] \u0027Webster\u0027s Third New International Dictionary, Unabridged.\u0027 Merriam-Webster. 2002.\u0026lt;/ref\u0026gt;, from \u0027komita\u0027 (from French \u0027comité\u0027 (committee) + \u0027-cı\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a unit of irregular soldiers or resistance fighters; a partisan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1942\u0027\u0027, \u0027Black Lamb and Grey Falcon\u0027, Canongate 2006, p. 808\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For a summer he worked as a \u0027\u0027comitadji\u0027\u0027 in Macedonia, and later joined the Serbian Army during the Balkan wars\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027The Sleepwalkers\u0027, Penguin 2013, p. 61\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He was a former \u0027\u0027\u0027comitadji\u0027\u0027\u0027 who had been involved in fomenting unrest in Bosnia after the annexation of 1908 and was even rumoured to have commanded guerrilla bands\", \"priority\":5}]}, \"synonyms\":{}}");

	add("comitative", "{\"term\":\"comitative\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The comitative case, or a word in this case\", \"priority\":1}]}, \"synonyms\":{}}");

	add("comitatus", "{\"term\":\"comitatus\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027comitatus\u0027 from \u0027comes\u0027 (companion)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a group of warriors or nobles accompanying a king or other leader\", \"priority\":1}]}, \"synonyms\":{}}");

	add("comma", "{\"term\":\"comma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027comma\u0027 from Ancient greek (to 1453) \u0027κόμμα\u0027 from \u0027κόπτω\u0027 (i cut)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Punctuation mark (\u0027\u0027\u0026lt;big\u0026gt;\u0026lt;big\u0026gt;\u0026lt;big\u0026gt;,\u0026lt;/big\u0026gt;\u0026lt;/big\u0026gt;\u0026lt;/big\u0026gt;\u0027\u0027) (usually indicating a pause between parts of a sentence or between elements in a list\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A diacritical mark used below certain letters in Romanian\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A European and North American butterfly, of the family Nymphalidae\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a difference in the calculation of nearly identical intervals by different ways\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A delimiting marker between items in a genetic sequence\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In Ancient Greek rhetoric a comma (κόμμα) is a short clause, something less than a colon, originally denoted by comma marks. In antiquity comma was defined as a combination of words that has no more than eight syllables. This term is later applied to longer phrases, e.g. the Johannine comma\", \"priority\":6}]}, \"synonyms\":{}}");

	add("commagene", "{\"term\":\"commagene\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Via Latin \u0027commagene\u0027 from Ancient greek (to 1453) \u0027κομμαγήνη\u0027 (sc\u003dpolytonic)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an ancient mountainous region in northeastern Anatolia, with a capital at Samosata\", \"priority\":1}]}, \"synonyms\":{}}");

	add("command", "{\"term\":\"command\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027comander\u0027 (modern French \u0027commander\u0027 , from *\u0027\u0027 () from Latin \u0027commendare\u0027 from \u0027com-\u0027 + \u0027mandare\u0027 from {{m|la|mandō||I order, command}}. Compare \u0027commend\u0027 \u0027mandate\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An order to do something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I was given a \u0027\u0027command\u0027\u0027 to cease shooting\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The right or authority to order, control or dispose of; the right to be obeyed or to compel obedience\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"to have \u0027\u0027command\u0027\u0027 of an army\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"power of control, direction or disposal; mastery\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"he had \u0027\u0027command\u0027\u0027 of the situation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"England has long held \u0027\u0027command\u0027\u0027 of the sea\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a good \u0027\u0027command\u0027\u0027 of language\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A position of chief authority; a position involving the right or power to order or control\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"General Smith was placed in \u0027\u0027command\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The act of commanding; exercise or authority of influence\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Command\u0027\u0027 cannot be otherwise than savage, for it implies an appeal to force, should force be needful.\u0027 (\u0027H. Spencer\u0027, Social Statics, p. 180\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A body or troops, or any naval or military force, under the control of a particular officer; by extension, any object or body in someone\u0027s charge\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, w:Joseph Joseph Conrad, \u0027s:Heart of Heart of Darkness\u0027, s:Heart of Darkness/Section section\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"I asked myself what I was to do there, now my boat was lost. As a matter of fact, I had plenty to do in fishing my \u0027\u0027command\u0027\u0027 out of the river\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Dominating situation; range or control or oversight; extent of view or outlook\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A directive to a computer program acting as an interpreter of some kind, in order to perform a specific task\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The degree of control a pitcher has over his pitches\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s got good \u0027\u0027command\u0027\u0027 tonight\", \"priority\":19}]}, \"synonyms\":{}}");

	add("commandant", "{\"term\":\"commandant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027commandant\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A commanding officer, usually of a specific force or division\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commander", "{\"term\":\"commander\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027comandeor\u0027 from \u0027comander\u0027 See command.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who exercises control and direction of a military or naval organization\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A naval officer whose rank is above that of a lieutenant commander and below that of captain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who exercises control and direction over a group of persons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A designation or rank in certain non-military organizations such as NASA and various police forces\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The chief officer of a commandry\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A heavy beetle or wooden mallet, used in paving, in sail lofts, etc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A rank within an honorary order: e.g. Commander of the Legion of Honour\", \"priority\":7}]}, \"synonyms\":{}}");

	add("commando", "{\"term\":\"commando\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"Afrikaans\", \"English\", \"Latin\", \"Portuguese\"], \"text\":\"From Afrikaans \u0027kommando\u0027 from Portuguese \u0027comando\u0027 (command) lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;, from *\u0027\u0027 (commandare) from Latin \u0027commendare\u0027 from \u0027com-\u0027 + \u0027mandare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small fighting force specially trained for making quick destructive raids against enemy-held areas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027A Savage War of Peace\u0027, New York Review Books 2006, p. 89\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The most important objective was at Batna itself, where a group of three \u0027\u0027commandos\u0027\u0027 each comprising ten men was to attack Deleplanque\u0027s sub-prefecture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A commando troope\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An organized force of Boer troops in South Africa; a raid by such troops\", \"priority\":5}]}, \"synonyms\":{}}");

	add("commata", "{\"term\":\"commata\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the Latin {{m|la|commata}} (nominative plural form of {{m|en|comma}}), from the Ancient greek (to 1453) {{m|grc|κόμματα|κόμμᾰτᾰ|pos\u003dnominative plural form of {{l/grc|κόμμα|κόμμᾰ}}, \u0027kómma\u0027}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027 , \u0027The Catholic Encyclopedia\u0027, The Encyclopedia Press, Inc.; Volume IV, [http://books.google.com/books?id\u003d2GcQAAAAIAAJ\u0026amp;hl\u003den\u0026amp;pg\u003dPA82 page\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It will be noticed that the section “ E\u0026lt;small\u0026gt;T IN \u0026lt;/small\u0026gt;” and the cola begin at about the same perpendicular line, the \u0027\u0027commata\u0027\u0027 begin further in under the third or second letter, and so likewise does the continuation of a colon or comma which runs beyond a single line (see facsimile page).Category:English plurals ending in \u0026quot;-a\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("commemoration", "{\"term\":\"commemoration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{suffix|commemorate|ion|lang\u003den}}, from Old french (842-ca. 1400) \u0027commemoration\u0027 (French: commémoration), from Latin \u0027commemorationem\u0027, verb \u0027commemorare\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of commemorating; an observance or celebration designed to honor the memory of some person or event\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Whatever serves the purpose of commemorating; a memorial\", \"priority\":2}]}, \"synonyms\":{}}");

	add("commencement", "{\"term\":\"commencement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027commencement\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The first existence of anything; act or fact of commencing; rise; origin; beginning; start\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The time of Henry VII ... nearly coincides with the \u0027\u0027commencement\u0027\u0027 of what is termed modern history.\u0027 -allam\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1800\u0027\u0027, William Took, \u0027View of the Russian empire during the reign of Catharine the Second\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Yet from the \u0027\u0027commencement\u0027\u0027 of mining there have been unnoble proprietors of mines, who belonged to the class of merchants\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The day when degrees are conferred by colleges and universities upon students and others\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A graduation ceremony, from a school, college or university\", \"priority\":6}]}, \"synonyms\":{}}");

	add("commendation", "{\"term\":\"commendation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027commendacion\u0027 (approval, praise) from Latin \u0027commendatio\u0027 (recommendation, commendation) from \u0027commendare\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of commending; praise; favorable representation in words; recommendation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which is the ground of approbation or praise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A message of affection or respect; compliments; greeting\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An award or recognition for performance; a medal\", \"priority\":4}]}, \"synonyms\":{}}");

	add("commender", "{\"term\":\"commender\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|commend|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who commends\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, William Kimbrough Pendleton, \u0027The Millennial Harbinger, Volume 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Germans and the French became reformers; but the Anglo-Saxons were the first translators and \u0027\u0027commenders\u0027\u0027 of the Bible, and of universal Bible reading\", \"priority\":3}]}, \"synonyms\":{}}");

	add("commensalism", "{\"term\":\"commensalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|commensal|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sharing of the same environment by two organisms where one species benefits and the other is unaffected. An example is barnacles on whales\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of eating together; table fellowship.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("comment", "{\"term\":\"comment\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|coment}}, from Old french (842-ca. 1400) \u0027coment\u0027 (commentary) from \u0027commentum\u0027 from \u0027lang\u003dla|comminisci\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spoken remark\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"“A tight little craft,” was Austin’s invariable \u0027\u0027comment\u0027\u0027 on the matron; and she looked it, always trim and trig and smooth of surface like a converted yacht cleared for action\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A remark in source code which does not affect the behavior of the program\", \"priority\":3}]}, \"synonyms\":{}}");

	add("commentator", "{\"term\":\"commentator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|comment|ator|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who comments; especially someone who is paid to give his/her opinions in the media about current affairs, sports, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commenter", "{\"term\":\"commenter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|comment|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who comments\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commerce", "{\"term\":\"commerce\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|commerce}}, from Latin {{m|la|commercium}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The exchange or buying and selling of commodities; especially the exchange of merchandise, on a large scale, between different places or communities; extended trade or traffic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Social intercourse; the dealings of one person or class in society with another; familiarity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Macaulay\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Fifteen years of thought, observation, and \u0027\u0027commerce\u0027\u0027 with the world had made him [Bunyan] wiser\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, s:Robert Louis Robert Louis Stevenson, \u0027s:Virginibus Virginibus Puerisque\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Suppose we held our converse not in words, but in music; those who have a bad ear would find themselves cut off from all near \u0027\u0027commerce\u0027\u0027, and no better than foreigners in this big world\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"sexual Sexual intercourse\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A round game at cards, in which the cards are subject to exchange, barter, or trade\", \"priority\":8}]}, \"synonyms\":{}}");

	add("commercial", "{\"term\":\"commercial\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"{{suffix|commerce|ial|lang\u003den}}. From French \u0027commercial\u0027 (of, or pertaining to commerce)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An advertisement in a common media format, usually radio or television\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commerciality", "{\"term\":\"commerciality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|commercial|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ability to produce a profit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commercialization", "{\"term\":\"commercialization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|lang\u003den|commercialize|ation}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of commercializing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commiseration", "{\"term\":\"commiseration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027lang\u003dfrm\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of commiserating; sorrow for the wants, afflictions, or distresses of another; pity; compassion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1521052W A Cuckoo in the passage\u003dThe departure was not unduly prolonged.Within the door Mrs. Spoker hastily imparted to Mrs. Love a few final sentiments on the subject of Divine Intention in the disposition of buckets; farewells and last \u0027\u0027commiserations\u0027\u0027; a deep, guttural instigation to the horse; and the wheels of the waggonette crunched heavily away into obscurity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("commissaire", "{\"term\":\"commissaire\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The judge of a bicycle race\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commission", "{\"term\":\"commission\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027commission\u0027 from Latin \u0027commissio\u0027 (sending together; commission) from prefix \u0027com-\u0027 (with) + noun of action \u0027missio\u0027 (sending) from perfect passive participle \u0027missus\u0027 (sent) from the verb \u0027mittō\u0027 (to send) + noun of action suffix \u0027-io\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sending or mission (to do or accomplish something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was James Bond\u0027s \u0027\u0027commission\u0027\u0027 to defeat the bad guys\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An official charge or authority to do something, often used of military officers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"David received his \u0027\u0027commission\u0027\u0027 after graduating from West Point\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Let him see our \u0027\u0027commission\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The thing to be done as agent for another\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I have three \u0027\u0027commissions\u0027\u0027 for the city\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A body or group of people, officially tasked with carrying out a particular function\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"the European Commission; the Electoral Commission; the Federal Communications Commission\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The company\u0027s sexual harassment \u0027\u0027commission\u0027\u0027 made sure that every employee completed the on-line course\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Prescot\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027commission\u0027\u0027 was at once appointed to examine into the matter\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A fee charged by an agent or broker for carrying out a transaction\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"a reseller\u0027s \u0027\u0027commission\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The real-estate broker charged a four percent \u0027\u0027commission\u0027\u0027 for their knowledge on bidding for commercial properties; for their intellectual perspective on making a formal offer and the strategy to obtain a mutually satisfying deal with the seller in favour of the buyer\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The act of committing (e.g. a crime\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027commission\u0027\u0027, preparation or instigation of an act of terrorism\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Every \u0027\u0027commission\u0027\u0027 of sin introduces into the soul a certain degree of hardness\", \"priority\":19}]}, \"synonyms\":{}}");

	add("commissionship", "{\"term\":\"commissionship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|commission|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The role or office of commissioner\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commitment", "{\"term\":\"commitment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|commit|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or an instance of committing, putting in charge, keeping, or trust, especially\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of sending a legislative bill to committee for review\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Official consignment sending a person to prison or a mental health institutio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Promise or agreement to do something in the future, especially\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Act of assuming a financial obligation at a future dat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Being bound emotionally/intellectually to a course of action or to another person/other persons\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The trait of sincerity and focused purpose\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Perpetration, in a negative manner, as in a crime or mistake\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"State of being pledged or engaged\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The act of being locked away, such as in an institution for the mentally ill or jail\", \"priority\":10}]}, \"synonyms\":{}}");

	add("commitmentphobia", "{\"term\":\"commitmentphobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fear of committing oneself to a romantic relationship\", \"priority\":1}]}, \"synonyms\":{}}");

	add("committee", "{\"term\":\"committee\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"{{rfv-etymology|lang\u003den}} From {{suffix|commit|ee|lang\u003den}}, else revival of Anglo-norman \u0027commite\u0027 past participle of \u0027commettre\u0027 (to commit) from Latin \u0027committere\u0027 from \u0027con-\u0027 (with) + \u0027mittere\u0027 (to send)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a group of persons convened for the accomplishment of some specific purpose, typically with formal protocol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a guardian; someone in charge of another person deemed to be unable to look after himself or herself\", \"priority\":2}]}, \"synonyms\":{}}");

	add("committeeman", "{\"term\":\"committeeman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|committee|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who is a member of a committe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A man who is a local leader of a political party\", \"priority\":2}]}, \"synonyms\":{}}");

	add("commoditization", "{\"term\":\"commoditization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|commoditize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transformation of something into a commodit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commodity", "{\"term\":\"commodity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0027commoditee\u0027, from Anglo-norman \u0027commoditee\u0027, from Latin \u0027commoditat\u0027, \u0027commoditas\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Convenience; usefulness, suitability\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything movable (a good) that is bought and sold\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, James G. Carrier, \u0027Gifts and Commodities: Exchange and Western Capitalism Since 1700\u0027, [http://books.google.com/books?id\u003d7BwbwuPyLccC\u0026amp;pg\u003dPA122\u0026amp;dq\u003dcommodities+shopping\u0026amp;sig\u003ddozEQAUipFYsEyUTkKpSqKbSCqk p.122\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If a key part of shopping is the conversion of anonymous \u0027\u0027commodities\u0027\u0027 into possessions, shopping is a cultural as much as an economic activity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Rachel Pain, \u0027Introducing Social Geographies\u0027, [http://books.google.com/books?id\u003dFVb2cfVpST8C\u0026amp;pg\u003dPA26\u0026amp;dq\u003dcommodities+shopping\u0026amp;sig\u003dOhV4OSNFSU9DE2-UdUBQsFosh5Y p.26\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In human geography \u0026quot;\u0027\u0027commodities\u0027\u0027\u0026quot; usually refers to goods and services which are bought and sold. The simplest \u0027\u0027commodities\u0027\u0027 are those produced by the production system just before they are sold\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, William Leiss, Botterill, Jacki, \u0027Social Communication in Advertising: Consumption in the Mediated Marketplace\u0027, [http://books.google.com/books?id\u003dR_ELAoKRDb4C\u0026amp;pg\u003dPA307\u0026amp;dq\u003dcommodities+shopping\u0026amp;sig\u003dAyH9Brabe3RC16bitD6AOsfSfPw p.307\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Referring to the work of Bourdieu, Zukin (2004,38) notes that shopping is much more than the purchase of \u0027\u0027commodities\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Something useful or valuable\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jan. 14th, Somerset County Gazett\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"And Slade said: \u0026quot;It really makes me sad that football club chairmen and boards seem to have lost that most precious \u0027\u0027commodity\u0027\u0027 - patience. \u0026quot;Sam\u0027s sacking at Newcastle had, I suppose, been on the cards for a while, but it is really ridiculous to fire a manager after such a short time\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Self-interest; personal convenience or advantage\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Shall we employ the intelligence Heaven hath bestowed upon us for our greatest good, to our ruine? repugning natures desseign and the universal order and vicissitude of things, which implieth that every man should use his instruments and meanes for his owne \u0027\u0027commoditie\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"NYRB, 2001, vol.1, p.321\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"they commonly respect their own ends, \u0027\u0027commodity\u0027\u0027 is the steer of all their action\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"raw Raw materials, agricultural and other primary products as objects of large-scale trading in specialized exchanges\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The price of crude oil is determined in continuous trading between professional players in World\u0027s many \u0027\u0027commodities\u0027\u0027 exchanges\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Undifferentiated goods characterized by a low profit margin, as distinguished from branded products\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Although they were once in the forefront of consumer electronics, the calculators have become a mere \u0027\u0027commodity\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Anything which has both a use-value and an exchange-value\", \"priority\":20}]}, \"synonyms\":{}}");

	add("commodore", "{\"term\":\"commodore\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\"], \"text\":\"{{borrowing|nl|kommandeur|lang\u003den}}, from French \u0027commandeur\u0027 from Old french (842-ca. 1400) \u0027comandeor\u0027 (commander)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A naval officer holding a rank between captain and rear admiral\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A (temporary) commander over a collection of ships who is not an admiral\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The president of a yacht clu\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A commodore admira\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A rear admiral (lower half\", \"priority\":5}]}, \"synonyms\":{}}");

	add("commonality", "{\"term\":\"commonality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Variant form of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The common people; the commonalt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The joint possession of a set of attributes or characteristics\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, \u0026quot;Second life for war widows\u0026quot;, \u0027Time\u0027, 25 Jun 1969\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Zunin sold the idea to his military superiors in the fearful jargon of his profession: \u0026quot;In a situation where \u0027\u0027commonality\u0027\u0027 of loss of the husband is present, the group can be exceedingly supportive.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Such a shared attribute or characteristi\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A quality that applies to materiel or systems: (a) possessing like and interchangeable parts or characteristics enabling each to be utilized, or operated and maintained in common; (b) having interchangeable repair parts and/or components; (c) applying to consumable items interchangeably equivalent without adjustment\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, NASA, \u0027s:Space Shuttle Columbia Disaster Space Shuttle Columbia Disaster Transcript\u0027, transcript of radio communication\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"KLING: FYI I\u0027ve just lost four separate temperature transducers on the left side of the vehicle, hydraulic return temperatures. (pause) Two of them on system one and one in each of systems 2 and 3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"CAIN: Four hyd return temps\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"KLING: To the left outboard and left inboard elevons\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"CAIN: OK, is there anything common to them, DSC or MDM or anything? I mean, you\u0027re telling me you lost them all at exactly the same time\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"KLING: No, not exactly. They were within probably four or five seconds of each other\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"CAIN: OK, where are those? Where is that instrumentation located\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"KLING: All four of them are located in the aft part of the left wing, right in front of the elevons, elevon actuators. And there is no \u0027\u0027commonality\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"CAIN: No \u0027\u0027commonality\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"long pause\", \"priority\":16}]}, \"synonyms\":{}}");

	add("commons", "{\"term\":\"commons\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dining hall, usually at a college or university\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A central section of (usually an older) town, designated as a shared area, a common\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Renaissance festival started with the \u0026quot;peasants\u0026quot; meeting in the \u0027\u0027commons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The commons \u0027\u0027is\u0027\u0027 the green space surrounded by the village hall, the school, and the church\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The commons of New England towns \u0027\u0027are\u0027\u0027 important contributors to their charm\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The mutual good of all; the abstract concept of resources shared by more than one, for example air, water, information\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;The tragedy of the \u0027\u0027commons\u0027\u0027\u0026quot; is that none wish to make sacrifices of their or their family\u0027s interests for the common good\", \"priority\":7}]}, \"synonyms\":{}}");

	add("commonty", "{\"term\":\"commonty\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\": \u0027\u00271594\u0027\u0027 \u0027Marry, I will; let them play it. Is not a \u0027\u0027commonty\u0027\u0027 a Christmas gambold or a tumbling-trick?\u0027 — Shakespeare, \u0027The Taming of the Shrew\u0027, s:The_Taming_of_the_Shre. SCENE_II._A_bedchamber_in_the_LORD.27S_house.|Induction (prologue), Scene 2\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Shakespeare\u0027s jesting mispronunciation of comedy, put into the mouth of Christopher Sly.Category:en:Comedy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("commonweal", "{\"term\":\"commonweal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The common good\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1843\u0027\u0027, Thomas Carlyle, \u0027:w:Past and Present Past and Present\u0027, book 2, ch. XIII, \u0027In Parliament\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He had to judge the people as justice Errant […]; to equip his \u0027milites\u0027, send them duly in war-time to the King; — strive every way that the \u0027\u0027Commonweal\u0027\u0027, in his quarter of it, take no damage\", \"priority\":3}]}, \"synonyms\":{}}");

	add("commotion", "{\"term\":\"commotion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027lang\u003dfrm\u0027 from Latin {{m|la|commōtiōnem}}, accusative singular of {{m|la|commōtiō}}, from {{m|la|commōtus}}, perfect passive participle of {{m|la|commoveō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of turbulent motion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An agitated disturbance or a hubbub\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d19|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dWhen Timothy and Julia hurried up the staircase to the bedroom floor, where a considerable \u0027\u0027commotion\u0027\u0027 was taking place, Tim took Barry Leach with him. He had him gripped firmly by the arm, since he felt it was not safe to let him loose, and he had no immediate idea what to do with him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sexual excitement\", \"priority\":4}]}, \"synonyms\":{}}");

	add("communication", "{\"term\":\"communication\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027communicacion\u0027 from Latin {{m|la|commūnicātiōnem}}, accusative singular of {{m|la|commūnicātiō||imparting, communicating}}, from {{m|la|commūnicō||I share, I impart}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or fact of communicating anything; transmission\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"communication\u0027\u0027 of smallpox\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"communication\u0027\u0027 of a secret\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The concept or state of exchanging data or information between entities\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some say that \u0027\u0027communication\u0027\u0027 is a necessary prerequisite for sentience; others say that it is a result thereof\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The node had established \u0027\u0027communication\u0027\u0027 with the network, but had as yet sent no data\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A message; the essential data transferred in an act of communication\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Surveillance was accomplished by means of intercepting the spies\u0027 \u0027\u0027communications\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The body of all data transferred to one or both parties during an act of communication\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The subpoena required that the company document their \u0027\u0027communication\u0027\u0027 with the plaintiff\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An instance of information transfer; a conversation or discourse\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The professors\u0027 \u0027\u0027communications\u0027\u0027 consisted of lively discussions via email\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Argument and friendly \u0027\u0027communication\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A passageway or opening between two locations; connection\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A round archway at the far end of the hallway provided \u0027\u0027communication\u0027\u0027 to the main chamber\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Arbuthno\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The Euxine Sea is conveniently situated for trade, by the \u0027\u0027communication\u0027\u0027 it has both with Asia and Europe\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A connection between two tissues, organs, or cavities\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1855,\u0027\u0027 William Stokes, \u0027The Diseases of the Heart and the Aorta\u0027 [http://books.google.com/books?vid\u003dOCLC02961152\u0026amp;id\u003dsaPwF2ZtUQ8C\u0026amp;pg\u003dRA1-PA617\u0026amp;lpg\u003dRA1-PA617\u0026amp;dq\u003dcommunication+%22vena+cava%22 Page 617\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"and here a free \u0027\u0027communication\u0027\u0027 had been established between the aorta and the vena cava\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Association; company\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Bible, 1 Corinthians xv. 3\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Evil \u0027\u0027communications\u0027\u0027 corrupt manners\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Participation in Holy Communion\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"A trope by which a speaker assumes that his hearer is a partner in his sentiments, and says \u0026quot;we\u0026quot; instead of \u0026quot;I\u0026quot; or \u0026quot;you\u0026quot\", \"priority\":26}]}, \"synonyms\":{}}");

	add("communiqué", "{\"term\":\"communiqué\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027communiqué\u0027 (something communicated) past participle of \u0027communiquer\u0027 (to communicate)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an official report or statement, such as a government press release or the report of a conference\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The final \u0027\u0027communiqué\u0027\u0027 of the G8 summit didn\u0027t even mention human rights\", \"priority\":2}]}, \"synonyms\":{}}");

	add("communitarianism", "{\"term\":\"communitarianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|communitarian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The group of doctrines that oppose excessive individualism in favour of a more community-based approac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Tony Blair dallied with \u0027\u0027communitarianism\u0027\u0027 in the mid-90s and was wont to quote the Quaker philosopher John Macmurray\", \"priority\":2}]}, \"synonyms\":{}}");

	add("communitas", "{\"term\":\"communitas\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|commūnitās}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unstructured community in which people are equal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The very spirit of community; an intense community spirit, the feeling of great social equality, solidarity, and togetherness\", \"priority\":2}]}, \"synonyms\":{}}");

	add("community", "{\"term\":\"community\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|communité}}, from Classical Latin {{m|la|communitas}}\u0026lt;ref\u0026gt;\u0026quot;community, n.\u0026quot; OED Online. July 2009. Oxford University Press [http://www.oed.com/view/Entry/37337?redirectedFrom\u003dcommunit. eid Article].\u0026lt;/ref\u0026gt;, from {{m|la|commūnis||common}}. Cognates include French \u0027communauté\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group sharing a common understanding and often the same language, manners, tradition and law. See civilization\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Halla\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Burdens upon the poorer classes of the \u0027\u0027community\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Wordswort\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Creatures that in \u0027\u0027communities\u0027\u0027 exist\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027community\u0027\u0027 is infinitely more brutalised by the habitual employment of punishment than it is by the occasional occurrence of crime\u0027 (Oscar Wilde\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A commune, or residential or religious collective\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The condition of having certain attitudes and interests in common\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d26|page\u003d19|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/may/27/globalisation-is-about-taxes-too Globalisation is about taxes passage\u003dIt is time the international \u0027\u0027community\u0027\u0027 faced the reality: we have an unmanageable, unfair, distortionary global tax regime. It is a tax system that is pivotal in creating the increasing inequality that marks most advanced countries today – with America standing out in the forefront and the UK not far behind\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A group of interdependent organisms inhabiting the same region and interacting with each other\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A group of people interacting by electronic means for social, professional, educational or other purposes; a virtual community\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Common possession or enjoyment; participation\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The original \u0027\u0027community\u0027\u0027 of all things\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An unreserved \u0027\u0027community\u0027\u0027 of thought and feeling\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"common character; likeness\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"H. Spence\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The essential \u0027\u0027community\u0027\u0027 of nature between organic growth and inorganic growth\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"commonness; frequenc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Eyes sick and blunted with \u0027\u0027community\", \"priority\":20}]}, \"synonyms\":{}}");

	add("commutant", "{\"term\":\"commutant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|commute|ant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The subset of all elements of a semigroup that commute with the elements of a given subse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;/math\u0026gt; a concrete C * -algebra 6 of bounded linear operators acting on a Hilbert space 7 \u0026lt;math\u0026gt;{ mathcal{H}}\u0026lt;/math\u0026gt; that is closed in the weak topology 8 or, equivalently, 9 that has the property that \u0026lt;math\u0026gt;({ mathfrak{M}}^{ prime})^{ prime}:\u003d{ mathfrak{M}}^{ prime prime }\u003d{ mathfrak{M}},\u0026lt;/math\u0026gt; where “′” denotes the \u0027\u0027commutant\", \"priority\":2}]}, \"synonyms\":{}}");

	add("commutation", "{\"term\":\"commutation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027commutation\u0027 from Latin {{m|la|commūtātiōnem}}, accusative singular of {{m|la|commūtātiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A passing from one state to another; change; alteration; mutation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of giving one thing for another; barter; exchange\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Substitution of one thing for another; interchange\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the substitution of one kind of payment for another, especially a switch to monetary payment from obligations of labour\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Philip Ziegler, \u0027The Black Death\u0027, Folio Society 2006, p. 213\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Professor Postan has argued in favour of a rapid move towards \u0027\u0027commutation\u0027\u0027 in the twelfth century which slackened or even went into reverse in the course of the thirteenth\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The change to a lesser penalty or punishment by the Stat\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Hilary Mantel, \u0027A Place of Greater Safety\u0027, Harper Perennial 2007, p. 23\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Monsieur the Marquis de Sade [was] now holed up in one of his châteaux while his wife worked for the \u0027\u0027commutation\u0027\u0027 of a sentence passed on him recently for poisoning and buggery\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Substitution, as a means of discriminating between phonemes\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The reversal of an electric current\", \"priority\":11}]}, \"synonyms\":{}}");

	add("commutativeness", "{\"term\":\"commutativeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being commutative\", \"priority\":1}]}, \"synonyms\":{}}");

