	add("companion", "{\"term\":\"companion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"frankish\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"gothic\", \"classical armenian\"], \"text\":\"From Middle english (1100-1500) {{m|enm|companion}}, from Old french (842-ca. 1400) {{m|fro|compaignon||companion}} (modern French {{m|fr|compagnon}}), from {{m|la||compāniōn-}} (nominative singular {{m|la|compāniō}}, whence French {{m|fr|copain}}), from {{prefix|com|pānis|lang\u003dla|nocat\u003d1}} (literally, with + bread), a word first attested in the Frankish \u0027Lex Salica\u0027 as a translation of a Germanic word, probably Frankish {{m|frk|*galaibo}}, {{m|frk|*gahlaibo||messmate|lit\u003dwith-bread}}, from Proto-germanic {{m|gem-pro|*hlaibaz||loaf, bread}}. Compare also Old high german (ca. 750-1050) {{m|goh|galeipo||messmate}}, Gothic {{m|got|𐌲𐌰𐌷𐌻𐌰𐌹𐌱𐌰||messmate}}, Classical armenian {{m|xcl|ընկեր||friend|lit\u003dmessmate}}. More at co-, loaf.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A friend, acquaintance, or partner; someone with whom one spends time or keeps compan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His dog has been his trusted \u0027\u0027companion\u0027\u0027 for the last five years\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Here are your sons again; and I must lose / Two of the sweetest \u0027\u0027companions\u0027\u0027 in the world\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person employed to accompany or travel with another\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The framework on the quarterdeck of a sailing ship through which daylight entered the cabins below\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The covering of a hatchway on an upper deck which leads to the companionway; the stairs themselves\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A knot in whose neighborhood another, specified knot meets every meridian disk\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A thing or phenomenon that is closely associated with another thing, phenomenon, or person\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A celestial object that is associated with another\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A knight of the lowest rank in certain orders\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027companion\u0027\u0027 of the Bath\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A fellow; a rogue\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1599\u0027\u0027, w: William William Shakespeare, \u0027s: The Merry Wives of The Merry Wives of Windsor\u0027, III. i. 111\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"and let us knog our / prains together to be revenge on this same scald, scurvy, / cogging \u0027\u0027companion\", \"priority\":15}]}, \"synonyms\":{}}");

