	add("compare", "{\"term\":\"compare\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027comparer\u0027 from Latin {{lena}} \u0027comparare\u0027 (to prepare, procure) from \u0027compar\u0027 (like or equal to another) from \u0027\u0027 + \u0027par\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"compariso\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His mighty champion, strong beyond \u0027\u0027compare\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Walle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Their small galleys may not hold \u0027\u0027compare\u0027\u0027 with our tall ships\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"illustration by comparison; simil\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Rhymes full of protest, of oath, and big \u0027\u0027compare\u0027\u0027.Category:1000 English basic words\", \"priority\":8}]}, \"synonyms\":{}}");

	add("compartmentalization", "{\"term\":\"compartmentalization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|compartmentalize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of dividing a complex task or structure into smaller, often more manageable pieces\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of dividing complex code into libraries with common functionality to help make the process of programming more manageable and reusable\", \"priority\":2}]}, \"synonyms\":{}}");

	add("compass", "{\"term\":\"compass\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"For noun: from Middle english (1100-1500) \u0027compas\u0027 (a circle, circuit, limit, form, a mathematical instrument) from Old french (842-ca. 1400) \u0027compas\u0027 from \u0027compassus\u0027 () from Latin \u0027com-\u0027 (together) + \u0027passus\u0027 () see pass, pace.For verb: from Middle english (1100-1500) \u0027compassen\u0027 (to go around, make a circuit, draw a circle, contrive, intend) from Old french (842-ca. 1400) \u0027compasser\u0027 from the noun; see compass as a noun.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A magnetic or electronic device used to determine the cardinal directions (usually Magnetic magnetic or true north\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"John Lock\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He that first discovered the use of the \u0027\u0027compass\u0027\u0027 did more for the supplying and increase of useful commodities than those who built workhouses\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pair of compasses (a device used to draw an arc or circle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"to fix one foot of their \u0027\u0027compass\u0027\u0027 wherever they pleas\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The range of notes of a musical instrument or voice\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"You would sound me from my lowest note to the top of my \u0027\u0027compass\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A space within limits; area\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1763\u0027\u0027, M. Le Page Du Pratz, \u0027History of Louisiana\u0027 (PG), page 47\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In going up the Missisippi \u0027[sic]\u0027, we meet with nothing remarkable before we come to the Detour aux Anglois, the English Reach: in that part the river takes a large \u0027\u0027compass\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Their wisdom lies in a very narrow \u0027\u0027compass\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, w:D. H. D.H. Lawrence, Sons and Lovers\u0027, s:Sons and Lovers/Chapter chapter 1\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Clara thought she had never seen him look so small and mean. He was as if trying to get himself into the smallest possible \u0027\u0027compass\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An enclosing limit; boundary; circumference\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"within the \u0027\u0027compass\u0027\u0027 of an encircling wall\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Moderate bounds, limits of truth; moderation; due limits; used with \u0027within\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Sir J. Davie\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"In two hundred years before (I speak within \u0027\u0027compass\u0027\u0027), no such commission had been executed\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Scope\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Wordswort\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027compass\u0027\u0027 of his argumen\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"1748\u0027\u0027, David Hume, \u0027Enquiries concerning the human understanding and concerning the principles of moral\u0027, Oxford University Press (1973), section 8\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"There is a truth and falsehood in all propositions on this subject, and a truth and falsehood, which lie not beyond the \u0027\u0027compass\u0027\u0027 of human understanding\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"1844\u0027\u0027, Marginalia\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"How very commonly we hear it remarked that such and such thoughts are beyond the \u0027\u0027compass\u0027\u0027 of words! I do not believe that any thought, properly so called, is out of the reach of language\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"A passing round; circuit; circuitous course\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"Bible, 2 Kings iii\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"They fetched a \u0027\u0027compass\u0027\u0027 of seven days\u0027 journey\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"This day I breathed first; time is come round, / And where I did begin, there shall I end; / My life is run his \u0027\u0027compass\", \"priority\":33}]}, \"synonyms\":{}}");

	add("compassion", "{\"term\":\"compassion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) from \u0027compassio\u0027 () from \u0027\u0027 past participle \u0027compassus\u0027 () from Latin \u0027com-\u0027 (together) + \u0027pati\u0027 () see passion.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Deep awareness of the suffering of another, coupled with the wish to relieve i\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, Robert Leighton (Archbishop of Glasgow), \u0027A practical commentary upon the first Epistle of St. Peter\u0027 (page 47\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Oh! the unspeakable privilege to have Him for our Father, who is the Father of mercies and \u0027\u0027compassions\u0027\u0027, and those not barren, fruitless pityings, for He is withal the God of all consolations\", \"priority\":3}]}, \"synonyms\":{}}");

	add("compatibilism", "{\"term\":\"compatibilism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine that free will and determinism are compatible ideas\", \"priority\":1}]}, \"synonyms\":{}}");

	add("compeer", "{\"term\":\"compeer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027comper\u0027 from Middle french (ca. 1400-1600) \u0027comper\u0027 from Latin {{lena}} \u0027compar\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the equal or peer of someone else; someone who is a close companion or associate of someone els\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And him thus answer\u0027d soon his bold \u0027\u0027compeer\", \"priority\":3}]}, \"synonyms\":{}}");

	add("compensation", "{\"term\":\"compensation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027compensacion\u0027 from Latin {{m|la|compensātiōnem}}, accusative singular of {{m|la|compensātiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or principle of compensating\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which constitutes, or is regarded as, an equivalent; that which makes good the lack or variation of something else; that which compensates for loss or privation; amends; remuneration; recompense\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Halla\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The parliament which dissolved the monastic foundations vouchsafed not a word toward securing the slightest \u0027\u0027compensation\u0027\u0027 to the dispossessed owners\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"No pecuniary \u0027\u0027compensation\u0027\u0027 can possibly reward them\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The extinction of debts of which two persons are reciprocally debtors by the credits of which they are reciprocally creditors; the payment of a debt by a credit of equal amount; a set-off\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A recompense or reward for some loss or service\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An equivalent stipulated for in contracts for the sale of real estate, in which it is customary to provide that errors in description, etc., shall not avoid, but shall be the subject of compensation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The relationship between air temperature outside a building and a calculated target temperature for provision of air or water to contained rooms or spaces for the purpose of efficient heating. In building control systems the compensation curve is defined to a compensator for this purpose\", \"priority\":9}]}, \"synonyms\":{}}");

	add("comper", "{\"term\":\"comper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who enters many competitions in order to win as many prizes as possible\", \"priority\":1}]}, \"synonyms\":{}}");

	add("compere", "{\"term\":\"compere\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027compère\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A master of ceremonies, especially for a television, variety or quiz show\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Every year I am the \u0027\u0027compere\u0027\u0027 for our Church Quiz Night\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Kerry Katona, \u0027The Footballer\u0027s Wife\u0027, ISBN 9781407022178, [http://books.google.com/books?id\u003dPQpax2DcvL0C\u0026amp;pg\u003dPA157\u0026amp;dq\u003d%22the+compere%22 page 157\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027compere\u0027\u0027 came onto the stage holding the gold envelope that contained the winner\u0027s name\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Steve Taberner, \u0027The Wigan Hammer: The Autobiography by Steve Taberner\u0027, AuthorHouse (2012), ISBN 9781468578713, [http://books.google.com/books?id\u003dI0KVd6ga49MC\u0026amp;pg\u003dSA2-PA49\u0026amp;dq\u003d%22a+compere%22 page 249\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Not only for his fighting expertise but also reminiscent of a \u0027\u0027compere\u0027\u0027 in a cabaret show working the crowd, as a build up to the main event\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Sue Welfare, \u0027One Night Only\u0027, HarperCollins (2012), ISBN 9780007461721, [http://books.google.com/books?id\u003dBYepTuXvc7YC\u0026amp;pg\u003dPT189\u0026amp;dq\u003d%22the+compere%22 unnumbered page\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"They were barely settled when the final song came to an end; the audience began to applaud and after a few more seconds the voice of the \u0027\u0027compere\u0027\u0027 came over the PA\", \"priority\":8}]}, \"synonyms\":{}}");

	add("compersion", "{\"term\":\"compersion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The feeling of joy one has experiencing another\u0027s joy, such as in witnessing a toddler\u0027s joy and feeling joy in response\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The feeling of joy associated with seeing a loved one love another; \u0027contrasted with\u0027 jealousy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Ayala Malach Pines, \u0027Romantic Jealousy\u0027, \u0027Causes, Symptoms, Cures\u0027, Routledge, ISBN 0415920108, page 14\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A major component of jealousy, for many people, is the suspicion or resentment of the rival. In Kerista, on the other hand, the relationship that every man had with the other men and that every woman had with the other women elicited what they called “\u0027\u0027compersion\u0027\u0027” rather than jealousy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mystic Life (author), \u0027Spiritual Polyamory\u0027, iUniverse, ISBN 0595305415, page 4\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"There is nothing either magical or wrong with sex with more than one person at the same time.\u0027...\u0027 The beautiful thing about this dynamic is that it offers opportunities for \u0027\u0027compersion\u0027\u0027 (the opposite of jealousy) and is symbolic of the expansiveness and unity we can feel in our love for each other\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Serena Anderlini-D’Onofrio (editor), \u0027Plural Loves\u0027, Haworth Press, ISBN 1560232935, page 17\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I think this is the easiest way to teach \u0027\u0027compersion\u0027\u0027, to immerse oneself in the unconditional approval of another person’s pleasure\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"We usually seek \u0027\u0027compersion\u0027\u0027 in the context of our lover being sexual with another person, which can be very beautiful, but equally scary\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Compersion\u0027\u0027 is the coveted secret elixer of emotions because it promises to turn the pain of jealousy into an ecstatic calm, or ecstatic release\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Ronald C. Fox, Ph.D. (editor), \u0027Affirmative Psychotherapy with Bisexual Women and Bisexual Men\u0027, Haworth Press, ISBN 1560232994, page 14\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Some polyamorous people experience \u0027\u0027\u0027compersion\u0027\u0027\u0027\u0026lt;!--italics in original--\u0026gt;, which means feeling joy that one’s partner is sharing closeness with another person (Keener, 2004; Polyamory Society, 1997). Keener’s (2004) study participants noted an absence of worry as to whether their partners might be cheating\u0026lt;!--,--\u0026gt\", \"priority\":12}]}, \"synonyms\":{}}");

	add("competence", "{\"term\":\"competence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027compétence\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being competent, i.e. able or suitable for a general role\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Lies Sercu and Ewa Bandura, \u0027Foreign Language Teachers and Intercultural Competence: An International Investigation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Teachers are now required to teach intercultural communicative \u0027\u0027competence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being able or suitable for a particular task; the quality or state of being competent for a particular task\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, National Council for Elementary Science (U.S.), \u0027Science Education\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What professional \u0027\u0027competences\u0027\u0027 do science teachers need\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sustainable income\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Reason\u0027s whole pleasure, all the joys of sense, / Lie in three words \u0026amp;mdash; health, peace, and \u0027\u0027competence\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1811\u0027\u0027, Jane Austen, \u0027Sense and Sensibility\u0027, chapter 1\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"lt;!--...--\u0026gt;“money can only give happiness where there is nothing else to give it. Beyond a \u0027\u0027competence\u0027\u0027, it can afford no real satisfaction, as far as mere self is concerned\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In law, the legal authority to deal with a matter\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"That question is out with the \u0027\u0027competence\u0027\u0027 of this court and must be taken to a higher court\", \"priority\":13}]}, \"synonyms\":{}}");

	add("competency", "{\"term\":\"competency\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027compétence\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sufficient supply (of\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1612\u0027\u0027, John Smith, \u0027Proceedings of the English Colonie in Virginia\u0027, in Kupperman 1988, p. 178\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the next day they returned unsuspected, leaving their confederates to follow, and in the interim, to convay them a \u0027\u0027competencie\u0027\u0027 of all things they could\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"it would appear that before taking this precaution Mr. Bree must have had the thrift to remove a modest \u0027\u0027competency\u0027\u0027 of the gold\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A sustainable income\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Superfluity comes sooner by white hairs, but \u0027\u0027competency\u0027\u0027 lives longer\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, w:W. Somerset W.S. Maugham, \u0026quot;w:Of Human Of Human Bondage\u0026quot;, s:Of Human Bondage/Chapter chapter 116\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"He had heard people speak contemptuously of money: he wondered if they had ever tried to do without it. He knew that the lack made a man petty, mean, grasping; it distorted his character and caused him to view the world from a vulgar angle; when you had to consider every penny, money became of grotesque importance: you needed a \u0027\u0027competency\u0027\u0027 to rate it at its proper value\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The ability to perform some task; competence\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The loan demonstrates, in regard to instrumental resources, the \u0027\u0027competency\u0027\u0027 of this kingdom to the assertion of the common cause\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Bill Clinton, \u0027My Life\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"By the year 2000, American students will leave grades four, eight, and twelve having demonstrated \u0027\u0027competency\u0027\u0027 in challenging subject matter including English, mathematics, science, history, and geography\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Meeting specified qualifications to perform\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"implicit knowledge of a language’s structure\", \"priority\":15}]}, \"synonyms\":{}}");

