	add("competition", "{\"term\":\"competition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027compétition\u0027 from \u0027competitio\u0027, from \u0027competere\u0027, from Latin {{m|la|petō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of compete competing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dThe humor of my proposition appealed more strongly to Miss Trevor than I had looked for, and from that time forward she became her old self again;. Our table in the dining-room became again the abode of scintillating wit and caustic repartee, Farrar bracing up to his old standard, and the demand for seats in the vicinity rose to an animated \u0027\u0027competition\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A contest for a prize or award\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The competitors in such a contest\", \"priority\":4}]}, \"synonyms\":{}}");

