	add("compilation", "{\"term\":\"compilation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Middle french (ca. 1400-1600) from Latin \u0027compilatio\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of compiling or gathering together from various sources\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which is compiled; especially, a book or document composed of materials gathering from other books or documents\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Translation of source code into object code by a compiler\", \"priority\":3}]}, \"synonyms\":{}}");

