	add("compiler", "{\"term\":\"compiler\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027compilour\u0027 from Old french (842-ca. 1400) \u0027compileur\u0027 from Latin \u0027compilatorem\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who compiles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027compiler\u0027\u0027 of poetry anthologies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"my favourite crossword \u0027\u0027compiler\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A computer program which transforms source code into object code\", \"priority\":4}]}, \"synonyms\":{}}");

	add("complacence", "{\"term\":\"complacence\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From mediaeval Latin \u0027complacentia\u0027 from Latin \u0027complaceo\u0027 (please)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Being complacent; a feeling of contentment or satisfaction; complacency\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Atterbur\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The inward \u0027\u0027complacence\u0027\u0027 we find in acting reasonably and virtuously\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Pleasure, delight\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"O thou, my sole \u0027\u0027complacence\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Complaisance; a willingness to comply with others\u0027 wishes\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, \u0027Tom Jones\u0027, Folio Society 1973, pp. 33-4\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"He told his sister, if she pleased, the new-born infant should be bred up together with little Tommy; to which she consented, though with some little reluctance: for she had truly a great \u0027\u0027complacence\u0027\u0027 for her brother\", \"priority\":9}]}, \"synonyms\":{}}");

