	add("completeness", "{\"term\":\"completeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|complete|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state or condition of being complet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The property of a logical theory that whenever a wff is valid then it must also be a theorem. Symbolically, letting \u0027T\u0027 represent a theory within logic \u0027L\u0027, this can be represented as the property that whenever \u0026lt;math\u0026gt;T vDash phi\u0026lt;/math\u0026gt; is true, then \u0026lt;math\u0026gt;T vdash phi\u0026lt;/math\u0026gt; must also be true, for any wff \u0027\u0026amp;phi;\u0027 of logic \u0027L\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"THEOREM 37\u0026amp;deg;. (Gödel\u0027s \u0027\u0027completeness\u0027\u0027 theorem 1930.) \u0027In the predicate calculus H\u0027:\u0026lt;br\u0026gt;(a) \u0027If\u0027 \u0026lt;math\u0026gt; vDash F\u0026lt;/math\u0026gt; [\u0027or even if\u0027 \u0026lt;math\u0026gt; aleph_0\u0026lt;/math\u0026gt;-\u0026lt;math\u0026gt; vDash F\u0026lt;/math\u0026gt;], \u0027then\u0027 \u0026lt;math\u0026gt; vdash F\u0026lt;/math\u0026gt;. \u0027If\u0027 \u0026lt;math\u0026gt;E_1, . . . , E_k vDash F\u0026lt;/math\u0026gt; [\u0027or even if\u0027 \u0026lt;math\u0026gt;E_1, . . . , E_k aleph_0\u0026lt;/math\u0026gt;-\u0026lt;math\u0026gt; vDash F\u0026lt;/math\u0026gt;], \u0027then\u0027 \u0026lt;math\u0026gt;E_1, . . . , E_k vdash F\u0026lt;/math\u0026gt;.\u0026lt;br\u0026gt;(b\", \"priority\":3}]}, \"synonyms\":{}}");

	add("completion", "{\"term\":\"completion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin {{m|la|completio|completionem}}, from {{m|la|compleo|complere|to fill up, complete}}; comparable to English {{suffix|complete|tion|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or state of being or making something complete; conclusion, accomplishment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d10|passage\u003dMr. Cooke had had a sloop yacht built at Far Harbor, the \u0027\u0027completion\u0027\u0027 of which had been delayed, and which was but just delivered. […] The Maria had a cabin, which was finished in hard wood and yellow plush, and accommodations for keeping things cold\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The conclusion of an act of conveyancing concerning the sale of a property\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of making a metric space complete by adding points\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The space resulting from such an act\", \"priority\":5}]}, \"synonyms\":{}}");

