	add("complication", "{\"term\":\"complication\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) French|complication\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of complicating; the state of being complicated; intricate or confused relation of parts; entanglement; complexity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who doesn\u0027t fit in with the main scheme of things; an interloper; someone you need to placate\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A disease or diseases, or adventitious circumstances or conditions, coexistent with and modifying a primary disease, but not necessarily connected with it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A feature beyond basic time display in a timepiece\", \"priority\":4}]}, \"synonyms\":{}}");

