	add("complot", "{\"term\":\"complot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|frm|complot||crowd, plot|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plot (involving more than one person), conspirac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"s:The Spanish Act 3, Scene 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"LOR. Now to confirme the \u0027\u0027complot\u0027\u0027 thou hast cas\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Of all these practices, Ile spread the watch\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Vpon precise commandement from the kin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Strongly to guard the place where Pedringan\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This night shall murder haples Serberine\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"s:The Tragedy of Titus Andronicu\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"SCENE I. Plains near Act 5, Scene 1\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"AARON: / For I must talk of murders, rapes, and massacres\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Acts of black night, abominable deeds\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Complots\u0027\u0027 of mischief, treason, villainies\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Ruthful to hear, yet piteously perform\u0027d\", \"priority\":13}]}, \"synonyms\":{}}");

	add("complotter", "{\"term\":\"complotter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|complot|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who complots; a conspirator\", \"priority\":1}]}, \"synonyms\":{}}");

	add("component", "{\"term\":\"component\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|compōnēns}}, present participle of {{m|la|compōnō||assemble, put together}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A smaller, self-contained part of a larger entity. Often refers to a manufactured object that is part of a larger device\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/in-the-news-47 In the passage\u003dOxygen levels on Earth skyrocketed 2.4 billion years ago, when cyanobacteria evolved photosynthesis:. The evolutionary precursor of photosynthesis is still under debate, and a new study sheds light. The critical \u0027\u0027component\u0027\u0027 of the photosynthetic system is the \u0026amp;ldquo;water-oxidizing complex\u0026amp;rdquo;, made up of manganese atoms and a calcium atom\", \"priority\":2}]}, \"synonyms\":{}}");

	add("composition", "{\"term\":\"composition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027composicion\u0027 from Latin {{m|la|compositiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The proportion of different parts to make a whole\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The general makeup of something\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An agreement or treaty used to settle differences; later especially, an agreement to stop hostilities; a truce\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It will stoope and yeeld upon better \u0027\u0027compositions\u0027\u0027 to him that shall make head against it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1630\u0027\u0027, John Smith, \u0027True travels\u0027, in Kupperman 1988, p.50\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"with an incredible courage they advanced to the push of the Pike with the defendants, that with the like courage repulsed, that the Turks retired and fled into the Castle, from whence by a flag of truce they desired \u0027\u0027composition\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An agreement to pay money in order to clear a liability or obligation; a settling\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1745\u0027\u0027, Edward Young, \u0027Night-Thoughts\u0027, II\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Insidious death! should his strong hand arrest, / No \u0027\u0027composition\u0027\u0027 sets the prisoner free\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"an agreement or compromise by which a creditor or group of creditors accepts partial payment from a debtor\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A mixture or compound; the result of composing\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An essay\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The formation of compound words from separate words\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A work of music, literature or art\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1818\u0027\u0027, A letter dated 8 September 1818\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"and how good Mrs. West could have written such books and collected so many hard words, with all her family cares, is still more a matter of astonishment. \u0027\u0027Composition\u0027\u0027 seems to me impossible with a head full of joints of mutton and doses of rhubarb\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Typesetting\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Applying a function to the result of another\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Consistency; accord; congruity\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"There is no \u0027\u0027composition\u0027\u0027 in these news / That gives them credit\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Synthesis as opposed to analysis\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Sir Isaac Newto\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The investigation of difficult things by the method of analysis ought ever to precede the method of \u0027\u0027composition\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The arrangement and flow of elements in a picture\", \"priority\":25}]}, \"synonyms\":{}}");

	add("composter", "{\"term\":\"composter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|compost|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or business that composts wast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A container for producing compost\", \"priority\":2}]}, \"synonyms\":{}}");

	add("composure", "{\"term\":\"composure\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|compose|ure|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Calmness of mind or matter, self-possession\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We seek peace and \u0027\u0027composure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I. Watt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"When the passions are all silent, the mind enjoys its most perfect \u0027\u0027composure\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"“Did you want anything, ma’am?” I enquired, still preserving my external \u0027\u0027composure\u0027\u0027, in spite of her ghastly countenance and strange exaggerated manner\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The act of composing, or that which is composed; a composition\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Evely\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Signor Pietro, who had an admirable way both of \u0027\u0027composure\u0027\u0027 [in music] and teaching\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Orderly adjustment; disposition\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Woodwar\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Various \u0027\u0027composures\u0027\u0027 and combinations of these corpuscles\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"frame; make; temperamen\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027composure\u0027\u0027 must be rare indeed / Whom these things can not blemish\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A combination; a union; a bond\", \"priority\":16}]}, \"synonyms\":{}}");

	add("compote", "{\"term\":\"compote\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027compote\u0027 Cognate with compost.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dessert made of fruit cooked in sugary syrup\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A dish used for serving fruit\", \"priority\":2}]}, \"synonyms\":{}}");

	add("compressibleness", "{\"term\":\"compressibleness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|compressible|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being compressible\", \"priority\":1}]}, \"synonyms\":{}}");

	add("compression", "{\"term\":\"compression\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|compression}}, from Latin {{m|la|compressiō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An increase in density; the act of compressing, or the state of being compressed; compaction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The cycle of an internal combustion engine during which the fuel and air mixture is compressed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The process by which data is compressed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Due to the presence of long-range correlations in language [21], [22] it is not possible to compute accurate measures of the entropy by estimating block probabilities directly. More efficient nonparametric methods that work even in the presence of long-range correlations are based on the property that the entropy of a sequence is a lower bound to any lossless compressed version of it [15]. Thus, in principle, it is possible to estimate the entropy of a sequence by finding its length after being compressed by an optimal algorithm. In our analysis, we used an efficient entropy estimator derived from the Lempel-Ziv \u0027\u0027compression\u0027\u0027 algorithm that converges to the entropy [19], [23], [24], and shows a robust performance when applied to correlated sequences [25] (see Materials and Methods\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The electronic process by which any sound\u0027s gain is automatically controlled\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The deviation of a heavenly body from a spherical form\", \"priority\":6}]}, \"synonyms\":{}}");

	add("compressor", "{\"term\":\"compressor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device that produces pressure, such as a gas compressor that produces pressurized gas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A device that squeezes (compresses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An instrument for compressing an artery (especially the femoral artery) or other part\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An apparatus for confining or flattening between glass plates an object to be examined with the microscope; a compressorium\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A machine for compressing gases, especially an air compressor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A device that reduces the dynamic range of an audio signal\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A muscle that compresses certain parts\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A program or algorithm for compressing data\", \"priority\":8}]}, \"synonyms\":{}}");

	add("compromise", "{\"term\":\"compromise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027compromis\u0027 from \u0027compromissum\u0027 () prop. neuter of Latin \u0027compromissus\u0027 past participle of \u0027compromittere\u0027 () from \u0027com-\u0027 () + \u0027promittere\u0027 () see promise.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The settlement of differences by arbitration or by consent reached by mutual concessions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But basely yielded upon \u0027\u0027compromise\u0027\u0027 / That which his noble ancestors achieved with blows\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"All government, indeed every human benefit and enjoyment, every virtue and every prudent act, is founded on \u0027\u0027compromise\u0027\u0027 and barter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Halla\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An abhorrence of concession and \u0027\u0027compromise\u0027\u0027 is a never failing characteristic of religious factions\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A committal to something derogatory or objectionable; a prejudicial concession; a surrender\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027compromise\u0027\u0027 of character or right\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I was determined not to accept any fine speeches, to the \u0027\u0027compromise\u0027\u0027 of that sex the belonging to which was, after all, my strongest claim and title to them\", \"priority\":9}]}, \"synonyms\":{}}");

	add("compter", "{\"term\":\"compter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|la|computō|lang\u003dfr}}, to distinguish from the inherited \u0027conter\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A counter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A prison attached to a city court; a counter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, John Hamilton Baker, \u0027The Oxford History of the Laws of England\u0027, Oxford, page 28\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Each sheriff had his own \u0027\u0027compter\u0027\u0027, which were both prisons and offices, administered by the respective secondaries\", \"priority\":4}]}, \"synonyms\":{}}");

	add("compulsiveness", "{\"term\":\"compulsiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|compulsive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being compulsive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("compunction", "{\"term\":\"compunction\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) from \u0027compunctionem\u0027 (a pricking) from Latin \u0027compunctus\u0027 the past participle of \u0027compungere\u0027 (to severely prick) from \u0027com-\u0027 + \u0027pungere\u0027 (to prick)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pricking of conscience or a feeling of regret, especially one which is slight or fleeting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"H]e would have had no \u0027\u0027compunction\u0027\u0027 whatever in flinging him out of the highest window in Venice into the deepest water of the city\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, w:Bram Bram Stoker, \u0027Dracula\u0027, ch. 3\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I felt no \u0027\u0027compunction\u0027\u0027 in doing so, for under the circumstances I felt that I should protect myself in every way I could\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:D. H. D. H. Lawrence, \u0027Women in Love\u0027, ch. 8\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"But he felt, later, a little \u0027\u0027compunction\u0027\u0027. He had been violent, cruel with poor Hermione. He wanted to recompense her, to make it up\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027 February 16, Blaine Greteman, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,423486,00.html No Peace Dividend],\u0026quot; \u0027Time\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"As for average U.S. consumers, they\u0027ve shown little \u0027\u0027compunction\u0027\u0027 about buying diamonds that fund bloody militias in Africa\", \"priority\":8}]}, \"synonyms\":{}}");

	add("compurgation", "{\"term\":\"compurgation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027compurgātiōnem\u0027 from \u0027compurgāre\u0027 (to purify)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Acquitting someone from a formal charge or accusation following the sworn oaths of a number of other people; vindication\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Faramerz Dabhoiwala, \u0027The Origins of Sex\u0027, Penguin 2013, p. 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Between the later middle ages and the early seventeenth century, \u0027\u0027compurgation\u0027\u0027 appears to have become an increasingly onerous test to pass, perhaps reflecting tightening attitudes to sexual offenders\", \"priority\":3}]}, \"synonyms\":{}}");

	add("computation", "{\"term\":\"computation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027computation\u0027 from Latin \u0027computatiō\u0027 from \u0027computare\u0027 (sum up, reckon, compute) see compute.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of comput\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"computing; calculation; reckoning\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The result of computation; the amount computed\", \"priority\":3}]}, \"synonyms\":{}}");

	add("computer", "{\"term\":\"computer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|compute|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person employed to perform computations; one who computes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1927\u0027\u0027, J. B. S. Haldane, \u0027Possible Worlds and Other Essays\u0027, page 17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Only a few years ago Mr. Powers, an American \u0027\u0027computer\u0027\u0027, disproved a hypothesis about prime numbers which had held the field for more than 250 years\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA, page 116\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One Harvard \u0027\u0027computer\u0027\u0027, Annie Jump Cannon, used her repetitive acquaintance with the stars to devise a system of stellar classifications so practical that it is still in use today\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"by restriction, a male computer, where the female computer is called a computres\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A programmable electronic device that performs mathematical calculations and logical operations, especially one that can process, store and retrieve large amounts of data very quickly; now especially, a small one for personal or home use employed for manipulating text or graphics, accessing the Internet, or playing games or media\", \"priority\":7}]}, \"synonyms\":{\"list\":[{\"text\":\"box\", \"synonymQualifier\":\"SLANG\"}]}}");

	add("computercide", "{\"term\":\"computercide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|computer|cide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The destruction of a computer\", \"priority\":1}]}, \"synonyms\":{}}");

